import React from 'react';
import logo from "../images/logo.jpeg"


function Header(){
  return(
    <div id="header">
      <div id="logo-div">
      <img src={logo} alt='error'/>
      </div>
      <div>
      <RouterProvider id="top-bar-div" router={router} />
      </div>

    </div>
  )
}

export default Header
